import { Container } from "./style";
import { AiOutlineLogin } from "react-icons/ai";
import { BsCart } from "react-icons/bs";

function Header() {
  return (
    <Container>
      <h2>Kenzie Shop</h2>

      <nav>
        <ul>
          <li>
            carrinho <BsCart />
          </li>
          <li>
            entrar <AiOutlineLogin size={15} />
          </li>
        </ul>
      </nav>
    </Container>
  );
}

export default Header;
